import logo from './logo.png';
import './App.css';

function Description(str) {
  return (
    <div className="desc">
      <span>{str}</span>
    </div>
  );
}

function Header() {
  return (
    <div className="header">
      <img className="logo" src={logo} alt="RN"></img>
      <h1 className="name">Rujul Nayak</h1>
    </div>
  );
}

function Content() {
  return (
    <div className="content">

    </div>
  );
}

function App() {
  return (
    <div className="app">
      <Header></Header>
      <Content></Content>
    </div>
  );
}

export default App;
